import React from "react";

function Navbar() {
  return (
    <div style={{ backgroundColor: "#222", padding: "10px" }}>
      <button style={{ marginRight: "8px" }}>Usuarios</button>
      <button style={{ marginRight: "8px" }}>Equipos</button>
      <button style={{ marginRight: "8px" }}>Conductores</button>
      <button style={{ marginRight: "8px" }}>Inventario</button>
      <button>Armado</button>
    </div>
  );
}

export default Navbar;
